import React from "react";
import { BrowserRouter as Router, Route, Routes } from "react-router-dom";

import Users from "./user/pages/Users";

const App: React.FC = () => {
  return (
    <Router>
      <Routes>
        <Route path="/">
          <Users />
        </Route>
      </Routes>
    </Router>
  );
};

export default App;
